(window.webpackJsonp=window.webpackJsonp||[]).push([[2048],{2403:function(n,h,i){"use strict";i.r(h);var t=i(44),g=Object(t.a)({},(function(){var n=this,h=n.$createElement,i=n._self._c||h;return i("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[i("h1",{attrs:{id:"chuong-766-nhat-nguyen-trong-thuy-gia-ca"}},[i("a",{staticClass:"header-anchor",attrs:{href:"#chuong-766-nhat-nguyen-trong-thuy-gia-ca"}},[n._v("#")]),n._v(" Chương 766: Nhất Nguyên Trọng Thủy giá cả")]),n._v(" "),i("hr"),n._v(" "),i("p",[i("br"),i("br"),n._v("Chương 766: Nhất Nguyên Trọng Thủy giá cả"),i("br"),i("br"),n._v("Trương Huyền quả thực không nghe thấy Lạc Thất Thất la lên, Hồng Trần Đạp Thiên bộ thi triển, nhanh sát mặt đất, lặng yên không tiếng động bay về phía trước."),i("br"),i("br"),n._v("Ba lần thiên nhận danh sư, Minh Lý Chi Nhãn tấn cấp, đối phương đi sau khi đi qua dấu vết lưu lại mặc dù yếu ớt, rơi vào hốc mắt, vẫn như cũ có thể rõ ràng nhìn thấy."),i("br"),i("br"),n._v("“Ừm? Đây là đi đâu?”"),i("br"),i("br"),n._v("Đi theo dấu vết đằng sau dọc theo bên hồ đi một hồi, đột nhiên thẳng tắp hướng một cái dốc núi mà đi, Trương Huyền lộ ra vẻ nghi hoặc."),i("br"),i("br"),n._v("Cái này dốc núi, mặc dù chưa từng tới, nhưng phía trên cũng không chỗ ở, lúc này trời đã tối, nữ nhân này chạy đến nơi đây làm gì?"),i("br"),i("br"),n._v("Mượn nhờ màn đêm, tiếp tục tiến lên."),i("br"),i("br"),n._v("Trên sườn núi mọc đầy đủ loại bé nhỏ bụi cây, trên cao nhất là cái bát giác lương đình."),i("br"),i("br"),n._v("Loại này lương đình, tại học viện rất nhiều, vừa đến, cho học sinh hóng mát, thứ hai, có thể tùy ý dừng lại, giao lưu trong lòng đoạt được."),i("br"),i("br"),n._v("Tu luyện đốn ngộ, lý giải lên thông hiểu đạo lí, có đôi khi là chuyện trong nháy mắt, qua lại chơi đùa, có khả năng cái loại cảm giác này liền bỏ qua."),i("br"),i("br"),n._v("Dán chặt lấy lùm cây, Trương Huyền hướng lương đình bay đi, còn chưa tới đến gần, quả nhiên thấy một người xinh đẹp thân ảnh, đứng ở bên trong, bốn phía tinh quang chiếu xuống, lờ mờ như là một bộ bức họa xinh đẹp."),i("br"),i("br"),n._v("Không thể không nói, Hồ Yêu Yêu dáng người quả thực rất tốt, từ xa nhìn lại, như cùng một cái đêm tối U Linh, khiến cho người nhìn lên một cái, liền khó mà tự kềm chế."),i("br"),i("br"),n._v("Trương Huyền trong đầu có Thiên Đạo thư viện, loại trừ Lạc Nhược Hi để hắn hơi thất thố, liên tục hôn mê hai lần bên ngoài, cái khác nữ hài, cứ việc không có quá cảm thấy cảm giác, vẫn như cũ vì trước mắt vị này dáng người tán thưởng không ngớt."),i("br"),i("br"),n._v("“Được rồi, ra đi!”"),i("br"),i("br"),n._v("Đứng tại tiểu đình, tốt đẹp dáng người, hóa thành một cái câu người độ cong, Hồ Yêu Yêu đột nhiên mở miệng."),i("br"),i("br"),n._v("“Chẳng lẽ bị phát hiện?”"),i("br"),i("br"),n._v("Trương Huyền chấn động, ngay sau đó lắc đầu."),i("br"),i("br"),n._v("Hắn Hồng Trần Đạp Thiên bộ thi triển, người trên không trung, không lưu bên dưới bất cứ dấu vết gì, lại nói, cũng không phải theo sát ở phía sau, mà là mượn nhờ Minh Lý Chi Nhãn điều tra dấu vết, loại này theo dõi, đừng nói nàng một cái Hóa Phàm cửu trọng khó mà phát hiện, coi như cường giả Thánh vực muốn phát giác, cũng không có khả năng!"),i("br"),i("br"),n._v("“Ha ha, Yêu Yêu chính là linh mẫn, ta vừa mới đến, liền bị ngươi phát hiện...”"),i("br"),i("br"),n._v("Chính kỳ quái đối phương tại sao lại nói như vậy, liền nghe đến một cái cười tiếng vang lên, ngay sau đó dốc núi một bên, một đạo bàn chân đạp gió tiếng âm vang lên, một cái bóng người cao lớn liền rơi vào trong đình."),i("br"),i("br"),n._v("Là cái dung mạo thoạt nhìn chừng ba mươi tuổi thanh niên, một thân tu vi dâng trào như sông, thế mà cùng Hồ Yêu Yêu tương đương, cũng là Hóa Phàm cửu trọng cường giả."),i("br"),i("br"),n._v("Tu vi đi đến loại cảnh giới này, tuổi tác từ bề ngoài đã nhìn không ra."),i("br"),i("br"),n._v("Dung mạo là chừng ba mươi tuổi, chỉ sợ đã là sống ít nhất năm, sáu mươi năm."),i("br"),i("br"),n._v("Bất quá, đối với Hóa Phàm cảnh hơn hai trăm năm tuổi thọ, từng tuổi này, vẫn tính rất trẻ trung."),i("br"),i("br"),n._v("“Ngươi người cũng như tên, tu luyện Chân Dương công pháp, còn chưa tới đến gần tựa như mặt trời, liệt hỏa chói chang, muốn không bị người phát hiện cũng khó khăn!” Hồ Yêu Yêu còn chưa lên tiếng, một cái thanh âm nhàn nhạt liền vang lên, lại một bóng người đi tới gần."),i("br"),i("br"),n._v("Là nữ tử, cùng Hồ Yêu Yêu tuổi tác tương đương, dung mạo so với vị này yêu nghiệt, thế mà cũng không hề yếu, nhưng mà khí chất cùng đối phương tựa như hai loại cực đoan."),i("br"),i("br"),n._v("Yêu Yêu, như là yêu nghiệt, nhất cử nhất động, cũng rung động lòng người, để cho người ta có loại bắt đến trong ngực chà đạp cảm giác. Mà vị này, toàn thân thanh lãnh, giống như là khối băng, để người ngắm mà xa chi, không dám tới gần."),i("br"),i("br"),n._v("“Người cũng như tên? Chẳng lẽ là cái kia... Tiết Chân Dương?”"),i("br"),i("br"),n._v("Nhìn thấy liên tục tới hai người, Trương Huyền không dám nhúc nhích, giấu ở trong bụi cỏ, đồng thời trong lòng nghi hoặc."),i("br"),i("br"),n._v("Trước đó hắn từng nghe qua cái gì Chân Dương hội, hội trưởng chính là một cái gọi Tiết Chân Dương lớp năm học viên, hiện tại lại nghe nói như thế, lập tức liên hệ đến cùng một chỗ."),i("br"),i("br"),n._v("“Đúng vậy a, cái tên này quả thực sẽ không che lấp, nếu như giống như ta, Yêu Yêu liền sẽ không phát hiện!”"),i("br"),i("br"),n._v("Đang tại phỏng đoán, lại một thân ảnh xuất hiện."),i("br"),i("br"),n._v("Cái tên này giống như quỷ mị, nếu là không lên tiếng, ngay cả Trương Huyền cũng không có chú ý, căn bản nghĩ không ra từ nơi nào xuất hiện."),i("br"),i("br"),n._v("“Long Thương Nguyệt, ngươi tu luyện Hàn Nguyệt công pháp, mượn nhờ bóng đêm mà đi, kiếm được bản thân nam không nam nữ không nữ, ta cũng không giống như ngươi!” “Tiết Chân Dương” khẽ nói."),i("br"),i("br"),n._v("“Ngươi mới nam không nam nữ không nữ, có tin ta hay không giáo huấn ngươi một trận?” Gọi là Long Thương Nguyệt thanh niên, lập tức giận dữ."),i("br"),i("br"),n._v("“Đến ah, cho là ta sợ ngươi? Rất lâu không hoạt động gân cốt, đánh nhau một trận cũng không sao!”"),i("br"),i("br"),n._v("“Tiết Chân Dương” chân khí trong cơ thể nhúc nhích, phụ trợ chính xác người như là liệt diễm, bất cứ lúc nào cũng sẽ công kích."),i("br"),i("br"),n._v("“Bại tướng dưới tay, cũng dám cùng ta nói khoác không biết ngượng, đã ngươi muốn đánh, ta liền thành toàn...”"),i("br"),i("br"),n._v("Long Thương Nguyệt cười lạnh một tiếng."),i("br"),i("br"),n._v("Lập tức, hai người giương cung bạt kiếm."),i("br"),i("br"),n._v("“Được rồi, vừa thấy mặt liền rùm beng khung, cũng không biết thu lại, chẳng lẽ không biết hôm nay có việc muốn nói?”"),i("br"),i("br"),n._v("Hồ Yêu Yêu hừ một tiếng."),i("br"),i("br"),n._v("Nghe được nàng, bất cứ lúc nào cũng sẽ chiến đấu khí thế nới lỏng, hai người đồng thời cười một tiếng: “Cũng đúng, chúng ta có thể trong âm thầm giao đấu, hôm nay còn có chính sự muốn nói! Không thể chậm trễ sự tình.”"),i("br"),n._v("“Được rồi, người đều đến đông đủ, Đổng Hân, ngươi vừa trở về, nói một chút lấy được tin tức đi!”"),i("br"),i("br"),n._v("Thấy hai người vắng mặt tranh đấu, Hồ Yêu Yêu khoát tay áo, nhìn về phía cách đó không xa nữ tử."),i("br"),i("br"),n._v("“Ừm, chỗ kia ta đi một chuyến, lặng lẽ quan sát hai ngày, Chân Dương nói không sai, đồ vật khẳng định tồn tại. Nhưng mà... Mức độ nguy hiểm, cũng so tưởng tượng phải lớn, chỉ bằng bốn người chúng ta, ta sợ rất khó thành công!”"),i("br"),i("br"),n._v("Khuôn mặt thanh lãnh nữ tử Đổng Hân, chần chờ một chút, nói."),i("br"),i("br"),n._v("“Quả thực khó, không nói trước Tiên Thiên môi trường phức tạp, liền nói cái kia hai đầu đại gia hỏa, chúng ta cũng không cách nào mạnh mẽ chống đỡ.” Nói đến sự tình, Tiết Chân Dương lại không trước đó táo bạo, mà là mày nhăn lại."),i("br"),i("br"),n._v("“Đúng vậy a, nhất định phải bàn bạc kỹ hơn, nếu không, ta sợ đồ vật không được đến, làm không cẩn thận còn đem mạng góp đi vào!” Một bên Long Thương Nguyệt theo tiếng."),i("br"),i("br"),n._v("“Bàn bạc kỹ hơn? Làm sao thương nghị? Nếu ta đoán không lầm, thứ này trong tháng này khẳng định sẽ hoàn thiện, một khi chín mọng, cái kia hai cái đại gia hỏa tất nhiên sẽ thôn phệ, dùng để tẩy cân đốn tủy, đến lúc đó, đột phá chính là bọn họ, chúng ta liền không có biện pháp!”"),i("br"),i("br"),n._v("Tiết Chân Dương hất lên ống tay áo, khẽ nói."),i("br"),i("br"),n._v("“Chân Dương nói không sai, thứ này, một khi hoàn thiện, chúng ta xác thực lại không có cơ hội, nhất định phải đuổi tại hoàn thiện trước, trà trộn vào đi, sau đó tại hoàn thiện thời điểm, một lần hành động nhận được! Nếu không, đã mất đi cái cơ duyên này, muốn xung kích Bán Thánh... Không có vài chục năm khổ công, khó mà làm đến!” Hồ Yêu Yêu nhẹ gật đầu, mày nhíu lại nhanh."),i("br"),i("br"),n._v("“Ừm, đạo để ý đến chúng ta đều hiểu, hiện tại liền là như thế nào mới có thể công phá phòng ngự, giải quyết hết cái kia hai cái đại gia hỏa!”"),i("br"),i("br"),n._v("Tiết Chân Dương lắc đầu, nhịn không được nhìn về phía cách đó không xa nữ hài: “Đổng Hân, ngươi là thuần thú học viện nổi danh nhất thiên tài, như thế nào đối phó hai cái này, ngươi không phải nói có biện pháp không?”"),i("br"),i("br"),n._v("“Cái này hai đầu gia hỏa thân cư Thượng Cổ di thú huyết mạch, vật phẩm bình thường rất khó đả động, trước khi đi ra, ta không phải bàn giao sao? Để các ngươi mua sắm Nhất Nguyên Trọng Thủy, thứ này đối với thượng cổ huyết thống có tịnh hóa tác dụng, dùng cái này làm mồi nhử, có lẽ có thể để cho rơi vào bẫy rập! Một khi bị nhốt lại, chúng ta liền có cơ hội!”"),i("br"),i("br"),n._v("Đôi mi thanh tú nhíu lên, Đổng Hân nói một câu, ngẩng đầu nhìn về phía mọi người: “Đúng rồi, thứ này mua được chưa?”"),i("br"),i("br"),n._v("“Mua? Làm sao mua? Nhất Nguyên Trọng Thủy, một bình ngọc liền muốn mười vạn linh thạch trung phẩm, chúng ta giá trị bản thân ngươi cũng không phải không biết, đi nơi nào tìm nhiều tiền như vậy?” Tiết Chân Dương cười khổ lắc đầu."),i("br"),i("br"),n._v("Liền coi như bọn họ là lớp năm học viên, mười vạn linh thạch trung phẩm, cũng là rất cái kia lấy ra."),i("br"),i("br"),n._v("“Nhất Nguyên Trọng Thủy?”"),i("br"),i("br"),n._v("Giấu ở một bên Trương Huyền, trong lòng hơi động."),i("br"),i("br"),n._v("Ngũ Diệu Kim Thân tổng cộng ngũ trọng, dung hợp rất nhiều luyện thể pháp quyết về sau, đệ nhất trọng không cần phải mượn bảo vật, còn lại tứ trọng đều cần."),i("br"),i("br"),n._v("Đệ nhị trọng, địa tâm Hồng nham, mà đệ tam trọng muốn tu luyện, chính muốn cái này Nhất Nguyên Trọng Thủy tiến hành phụ trợ."),i("br"),i("br"),n._v("Thứ này chỉ nghe qua tên, cụ thể cái dạng gì, ở nơi nào, cũng không nghe qua, không nghĩ tới từ cái này trong miệng vài người, nhận được tin tức."),i("br"),i("br"),n._v("Bọn họ thế mà cũng muốn mua sắm."),i("br"),i("br"),n._v("“Mười vạn linh thạch trung phẩm... Chính là mười cái thượng phẩm... Rất đắt!”"),i("br"),i("br"),n._v("Hưng phấn đồng thời, cũng cảm thấy bất đắc dĩ."),i("br"),i("br"),n._v("Lấy hắn đối Ngũ Diệu Kim Thân đệ tam trọng hiểu rõ, muốn luyện thành, không sai biệt lắm cần mười bình trái phải Nhất Nguyên Trọng Thủy... Hắn trên người bây giờ, chỉ có mười cái linh thạch thượng phẩm, mua sắm một bình ngọc, muốn tu luyện, còn kém có chút nhiều a!"),i("br"),i("br"),n._v("“Trước mấy ngày không phải tân sinh đưa tin ư? Không nên có thể kiếm một món hời ư?”"),i("br"),i("br"),n._v("Nghe được Tiết Chân Dương khóc than, Đổng Hân nhịn không được nói."),i("br"),i("br"),n._v("Tân sinh vào trường học, các đại học biết, đều có thể kiếm một món hời, năm nay càng là mười năm một lần tuyển nhận chu kỳ, nghe nói có ba vạn tân sinh, nhiều người như vậy, coi như mỗi người kiếm lấy ba cái, mười vạn cũng gần như nhanh đủ!"),i("br"),i("br"),n._v("“Còn lợi nhuận một khoản, không đền đáy đi, là tốt lắm rồi! Hai ngày này sự tình, ngươi chẳng lẽ không biết?” Nghe nói như thế, Tiết Chân Dương còn chưa mở miệng, một bên Long Thương Nguyệt lắc đầu."),i("br"),i("br"),n._v("“Biết cái gì? Ta vừa tới đến, liền cho các ngươi truyền lại tin tức, ở đây tập hợp, còn chưa kịp trở về, chuyện gì xảy ra? Chẳng lẽ học viện can thiệp?” Đổng Hân kỳ quái nhìn qua."),i("br"),i("br"),n._v("Đi chỗ kia ngây người hai ngày, đến một lần một lần, không sai biệt lắm lại tiêu hao thời gian vài ngày, tối nay mới đi đến, học viện chuyện phát sinh, cũng không rõ ràng."),i("br"),i("br"),n._v("Mỗi lần khai giảng, lão sinh doạ dẫm tân sinh, là một loại sáo lộ, học viện cơ bản mặc kệ."),i("br"),i("br"),n._v("Vừa đến, vì ma luyện tân sinh ngạo khí, để hắn biết, nhân ngoại hữu nhân, sơn ngoại hữu sơn. Thứ hai, cũng có thể để rất nhiều danh sư, tốt hơn hợp tác, về sau, tốt hơn liên hợp cùng một chỗ, đối kháng Dị Linh tộc."),i("br"),i("br"),n._v("Học viện mặc kệ, tân sinh lại tốt lừa dối, hẳn là có thể lợi nhuận không ít, cái này cũng thành liền một loại sản nghiệp, làm sao nghe khẩu khí, còn bồi thường tiền?"),i("br"),i("br"),n._v("“Nói ngươi đừng không tin, tân sinh bên trong ra một cái quái thai, đem buôn bán hoàn toàn đảo loạn! Năm nay nhập môn khảo hạch, do các ngươi thuần thú học viện tổ chức, chuyện này, ngươi có lẽ đã biết rất sớm đi!”"),i("br"),i("br"),n._v("Long Thương Nguyệt nói."),i("br"),i("br"),n._v("“Ừm!” Đổng Hân nhẹ gật đầu: “Là Mi viện trưởng tự mình xuất thủ, sớm chuẩn bị hơn mấy tháng!”"),i("br"),i("br"),n._v("Nàng là thuần thú học viện phải kể đến siêu cấp thiên tài, cùng lão sư quan hệ cũng cũng không tệ, khảo hạch mới chuyện phát sinh, tin tức còn không có truyền ra, liền biết rồi."),i("br"),i("br"),n._v("Mi viện trưởng khắp nơi bắt làm hại bốn phương linh thú, nàng thậm chí còn tham dự, tự tay bắt bảy, tám đầu."),i("br"),i("br"),n._v("“Lần này khảo hạch, quy củ rất đơn giản, đánh giết một đầu Hóa Phàm tứ trọng đỉnh phong cấp bậc linh thú, coi là một điểm... Ngươi biết tân sinh bên trong cái kia cái quái thai, được bao nhiêu điểm ư?”"),i("br"),i("br"),n._v("Long Thương Nguyệt nói."),i("br"),i("br"),n._v("Tân sinh nhập môn khảo hạch đã qua vài ngày, làm Thương Nguyệt hội hội trưởng, hỏi thăm ra khảo hạch tình huống cụ thể, cũng không tính là gì việc khó."),i("br"),i("br"),n._v("Convert by: ThấtDạ"),i("br"),i("br"),i("br"),i("br")]),n._v(" "),i("hr"),n._v(" "),i("p",[i("a",{attrs:{href:"./chap-774"}},[n._v("Chương trước")]),n._v("  |  "),i("a",{attrs:{href:"./chap-776"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=g.exports}}]);